--
-- Create procedure `Proc_Potential_GetMaxCode`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Potential_GetMaxCode ()
COMMENT 'Lấy PotentialCode lớn nhất'
BEGIN
  -- =============================================
  -- Author:        LVKIEN
  -- Created date:  12/08/2022
  -- Description:   Lấy danh sách khách hàng và tổng số khách hàng có phân trang
  -- Modified by:   
  -- Code chạy thử: CALL Proc_potential_GetMaxCode();
  SELECT
    p.PotentialCode
  FROM potential p
  WHERE SUBSTRING(p.PotentialCode, 4) = (SELECT
      MAX(CAST(SUBSTRING(p.PotentialCode, 4) AS SIGNED))
    FROM potential p);
END
$$

--
-- Create procedure `Proc_Customer_UpdateOrgaPotential`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Customer_UpdateOrgaPotential (IN v_PotentialId char(36), IN v_PotentialName varchar(255), IN v_OrganizationId int, IN v_OrganizatonName varchar(255), IN v_ModifiedAt datetime, IN v_CustomerId char(36))
COMMENT 'cập nhật giá trị trong bảng potential và organization'
BEGIN

  UPDATE organization
  SET OrganizationName = v_OrganizatonName,
      ModifiedAt = v_ModifiedAt
  WHERE OrganizationId = v_OrganizationId;


  UPDATE potential
  SET PotentialName = v_PotentialName,
      ModifiedAt = v_ModifiedAt
  WHERE PotentialId = v_PotentialId;



  SELECT
    1;
END
$$

