--
-- Create procedure `Proc_Customer_GetPaging`
--
CREATE PROCEDURE Proc_Customer_GetPaging (IN v_Offset int, IN v_Limit int, IN v_Sort varchar(100), IN v_Where varchar(10000))
SQL SECURITY INVOKER
COMMENT 'Procedure lấy danh sách khách hàng và tổng số khách hàng có phân trang'
BEGIN
  -- =============================================
  -- Author:        LVKIEN
  -- Created date:  12/08/2022
  -- Description:   Lấy danh sách khách hàng và tổng số khách hàng có phân trang
  -- Modified by:   
  -- Code chạy thử: CALL `misa.web07.qtkd.kien`.Proc_Customer_GetPaging(0, 10, 'Vocative DESC', 'FirstName LIKE "%ườ%"');
  -- =============================================
  DROP TABLE IF EXISTS customer_combine;
  -- Tạo bảng tạm lưu tất cả thông tin liên quan đến customer
  CREATE TEMPORARY TABLE customer_combine (
    CustomerId char(36),
    PotentialId char(36),
    LastMiddleName varchar(50),
    FirstName varchar(50),
    FullName varchar(100),
    CompanyPhoneNum varchar(50),
    CustomerPhoneNum varchar(50),
    OtherPhoneNum varchar(50),
    CustomerEmail varchar(100),
    CompanyEmail varchar(100),
    TaxCode varchar(20),
    Zalo varchar(50),
    OrganizationId int,
    AddressId int,
    Description varchar(10000),
    SharingUse bit(1),
    DisableCall bit(1),
    DisableMail bit(1),
    Gender smallint,
    DateOfBirth date,
    Facebook varchar(255),
    Vocative smallint,
    Layout varchar(255),
    Owner varchar(255),
    DepartmentId int,
    PositionId int,
    SourceId int,
    CreatedAt datetime,
    CreatedBy varchar(100),
    ModifiedAt datetime,
    ModifiedBy varchar(100),
    HomeNumber varchar(100),
    AddressName varchar(255),
    CountryName varchar(100),
    CityName varchar(100),
    DistrictName varchar(100),
    WardName varchar(100),
    PostalCode varchar(20),

    DepartmentName varchar(255),

    OrganizationName varchar(255),
    BankAccount varchar(100),
    BankName varchar(100),
    CreatedAccountAt date,
    Domain varchar(255),
    Career varchar(255),
    RevenueName varchar(100),
    TypeName varchar(100),

    SourceName varchar(100),

    PositionName varchar(100),

    PotentialName varchar(100),
    CityId int,
    CountryId int,
    DistrictId int,
    WardID int,
    TypeId int,
    RevenueId int,
    PotentialCode char(36)
  );

    SELECT
      c.CustomerId,
      c.PotentialId,
      c.LastMiddleName,
      c.FirstName,

      CONCAT_WS(" ", TRIM(REPLACE(REPLACE(REPLACE(c.LastMiddleName, '\n', ' '), '\r', ' '), '\t', ' ')), TRIM(c.FirstName)) AS FullName,
      c.CompanyPhoneNum,
      c.CustomerPhoneNum,
      c.OtherPhoneNum,
      c.CustomerEmail,
      c.CompanyEmail,
      c.TaxCode,
      c.Zalo,
      c.OrganizationId,
      c.AddressId,
      c.Description,
      c.SharingUse,
      c.DisableCall,
      c.DisableMail,
      c.Gender,
      c.DateOfBirth,
      c.Facebook,
      c.Vocative,
      c.Layout,
      c.Owner,
      c.DepartmentId,
      c.PositionId,
      c.SourceId,
      c.CreatedAt,
      c.CreatedBy,
      c.ModifiedAt,
      c.ModifiedBy,

      address_combine.HomeNumber,
      address_combine.AddressName,
      address_combine.CountryName,
      address_combine.CityName,
      address_combine.DistrictName,
      address_combine.WardName,
      address_combine.PostalCode,

      d.DepartmentName,


      organization_combine.OrganizationName,
      organization_combine.BankAccount,
      organization_combine.BankName,
      organization_combine.CreatedAccountAt,
      organization_combine.Domain,
      organization_combine.Career,
      organization_combine.RevenueName,
      organization_combine.TypeName,

      s.SourceName,

      p.PositionName,

      p1.PotentialName,


      address_combine.CityId,
      address_combine.CountryId,
      address_combine.DistrictId,
      address_combine.WardID,
      organization_combine.TypeId,
      organization_combine.RevenueId,
      p1.PotentialCode

    FROM customer c
      LEFT JOIN (SELECT
          a.AddressId,
          a.HomeNumber,
          a.AddressName,
          c2.CountryName,
          c1.CityName,
          d.DistrictName,
          w.WardName,
          a.PostalCode,
          a.CountryId,
          a.CityId,
          a.DistrictId,
          a.WardID
        FROM address a
          LEFT JOIN city c1
            ON a.CityId = c1.CityId
          LEFT JOIN country c2
            ON a.CountryId = c2.CountryId
          LEFT JOIN district d
            ON a.DistrictId = d.DistrictId
          LEFT JOIN ward w
            ON a.WardID = w.WardId
        ORDER BY a.AddressId) AS address_combine
        ON c.AddressId = address_combine.AddressId
      LEFT JOIN department d
        ON c.DepartmentId = d.DepartmentId
      LEFT JOIN (SELECT
          o.OrganizationId,
          o.TypeId,
          o.RevenueId,
          o.OrganizationName,
          o.BankAccount,
          o.BankName,
          o.CreatedAccountAt,
          o.Domain,
          o.Career,
          r.RevenueName,
          t.TypeName
        FROM organization o
          LEFT JOIN revenue r
            ON o.RevenueId = r.RevenueId
          LEFT JOIN type t
            ON o.TypeId = t.TypeId
        ORDER BY o.OrganizationId) AS organization_combine
        ON c.OrganizationId = organization_combine.OrganizationId
      LEFT JOIN source s
        ON c.SourceId = s.SourceId
      LEFT JOIN positions p
        ON c.PositionId = p.PositionId
      LEFT JOIN potential p1
        ON c.PotentialId = p1.PotentialId
    GROUP BY c.CustomerId;
  IF IFNULL(v_Where, '') = '' THEN
    SET v_Where = '1 =1 ';
  END IF;
  IF IFNULL(v_Sort, '') = '' THEN
    SET v_Sort = 'ModifiedAt DESC';
  END IF;
  IF v_Limit = -1 THEN
    SET @filterQuery = CONCAT('SELECT * FROM customer_combine WHERE ', v_Where, ' ORDER BY ', v_Sort);

  ELSE
    SET @filterQuery = CONCAT('SELECT * FROM customer_combine WHERE ', v_Where, ' ORDER BY ', v_Sort, ' LIMIT ', v_Offset, ',', v_Limit);

  END IF;

  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;


  SET @filterQuery = CONCAT('SELECT count(CustomerId) AS TotalCount FROM customer_combine WHERE ', v_Where);
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;


END
$$

