DELIMITER $$

--
-- Create trigger `trgDeleteCustomer`
--
CREATE
DEFINER = 'root'@'localhost'
TRIGGER trgDeleteCustomer
AFTER DELETE
ON customer
FOR EACH ROW
BEGIN
  IF old.AddressId IS NOT NULL THEN
    DELETE
      FROM address
    WHERE AddressId = old.AddressId; -- AddressId - INT NOT NULL
  END IF;
  IF old.OrganizationId IS NOT NULL THEN
    DELETE
      FROM organization
    WHERE OrganizationId = OLD.OrganizationId;
  END IF;
  IF old.PotentialId IS NOT NULL THEN
    DELETE
      FROM potential
    WHERE PotentialId = OLD.PotentialId;
  END IF;

END
$$

